INSERT INTO `bantin` (`idTin`, `idNhom`, `tieude`, `trichdan`, `anhtrichdan`, `noidung`) VALUES
(1, '1', 'Sinh viên New Zealand tham quan và giao lưu với sinh viên Đại Học Tôn Đức Thắng', 'Ngày 27/7/2019, Đoàn sinh viên các đại học New Zealand...', , 'Ngày 27/7/2019, Đoàn sinh viên các đại học New Zealand gồm: Đại học Otago, Đại học Waitako, Đại học Massey, Đại học Auckland và Đại học Victoria đã đến thăm và giao lưu với sinh viên Đại học Tôn Đức Thắng (TDTU).\r\n\r\nĐoàn đã được hướng dẫn tham quan Cơ sở Tân Phong và giới thiệu về TDTU; tham gia những hoạt động teambuilding cùng sinh viên TDTU.\r\n\r\nBà Natalie Lulia, Trưởng đoàn sinh viên New Zealand tỏ ra rất ấn tượng về sự tự tin và khả năng giao tiếp bằng tiếng Anh của sinh viên và viên chức TDTU. Bà đánh giá nhiều sinh viên phát âm và trò chuyện lưu loát như người bản xứ.\r\n\r\nCác sinh viên tham gia Đoàn đều tỏ ra thích thú với những trải nghiệm tại TDTU và mong muốn có cơ hội đến học tập, trao đổi văn hoá tại Trường.\r\n\r\nTrước đó, các đại học nói trên cùng với Cơ quan giáo dục New Zealand (Education New Zealand: ENZ) đã đến thăm và làm việc với TDTU để thống nhất các chương trình hợp tác. Đợt giao lưu này là bước tiếp theo để triển khai các nội dung hợp tác về giáo dục đã thoả thuận giữa các bên.');
INSERT INTO `bantin` (`idTin`, `idNhom`, `tieude`, `trichdan`, `anhtrichdan`, `noidung`) VALUES
(2, '1', 'Đại học quốc gia Lào thăm và làm việc với Đại học Tôn Đức Thắng', 'Sáng ngày 03/9/2019, Đoàn đại học quốc gia Lào...', , 'Sáng ngày 03/9/2019, Đoàn đại học quốc gia Lào (National University of Laos: NUoL) do TS. Houngphet Chanthavong, Phó hiệu trưởng dẫn đầu đã đến thăm và làm việc với Đại học Tôn Đức Thắng (TDTU). Cùng đi với Đoàn có bà Vongphan Phomphiphack, Phó tổng lãnh sự Cộng hòa dân chủ nhân dân (CHDCND) Lào tại Thành phố Hồ Chí Minh (TPHCM). TS. Võ Hoàng Duy, Phó hiệu trưởng TDTU cùng Lãnh đạo Phòng sau đại học, Khoa giáo dục quốc tế, Viện hợp tác quốc tế và nghiên cứu-phát triển đã tiếp Đoàn\r\n\r\nTS. Võ Hoàng Duy đã giới thiệu về đặc trưng của mô hình đại học công lập tự chủ, những thế mạnh về giáo dục quốc tế ở TDTU; từ đó đề xuất những triển vọng hợp tác trong mọi lĩnh vực ở bậc đại học và sau đại học với NUoL.\r\n\r\nTS. Chanthavong, đánh giá TDTU là một đại học uy tín, có chất lượng giáo dục đẳng cấp thế giới, đào tạo những ngành nghề mà xã hội rất cần, với chất lượng đầu ra được siết chặt. Dựa trên Bản ghi nhớ hợp tác năm 2014, ông mong muốn hai bên tiếp tục triển khai mạnh mẽ hơn nữa hợp tác về nghiên cứu và giáo dục. Lãnh đạo NUoL đã chính thức mời đại diện TDTU đến thăm NUoL và chia xẻ về mô hình tự chủ của TDTU để áp dụng cho các đại học ở Lào.\r\n\r\nĐại diện Lãnh sự quán CHDCND Lào tại TPHCM, bà Phomphiphack cảm ơn TDTU đã tạo nhiều cơ hội và điều kiện tốt nhất cho sinh viên Lào để được học tập tại TDTU.\r\n\r\nNUoL được thành lập năm 1996, trên cơ sở 10 đơn vị giáo dục đại học lớn của Lào. Sinh viên tốt nghiệp NUoL trở thành nguồn nhân lực chủ yếu tại các bộ ngành địa phương, phục vụ tốt cho sự nghiệp xây dựng và phát triển đất nước Lào.\r\nMột số hình ảnh tại Buổi làm việc:');

